import rws_app_logo from './assets/rws_logo.png';
import { useState } from 'react';
import { motion } from 'framer-motion';

function App() {
  const [email, setEmail] = useState("");
  const [password, setPass] = useState("");
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState("");

  const login_logic = async (e) => {
    e.preventDefault();
    setLoading(true);
    setMessage("");
    try {
      const res = await fetch("http://localhost:5000/auth/login", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ email, password }),
      });
      const data = await res.json();
      if (res.ok) {
        setMessage("✅ Login successful!");
      } else {
        setMessage(`❌ ${data.message || "Login failed"}`);
      }
    } catch (err) {
      setMessage("⚠️ Server error. Check your connection.");
    }
    setLoading(false);
  };

  return (
    <div className="relative min-h-screen flex items-center justify-center overflow-hidden bg-gradient-to-br from-[#f9fafb] via-[#eef3f8] to-[#e6edf5] text-[#1f2937]">
      {/* === BACKGROUND LIGHTS === */}
      <div className="absolute inset-0 overflow-hidden">
        <motion.div
          className="absolute w-[20rem] h-[20rem] bg-[#FEDB59]/70 rounded-full blur-[100px]"
          animate={{
            x: ['0%', '60%', '-40%', '0%'],
            y: ['0%', '-30%', '40%', '0%'],
          }}
          transition={{ duration: 20, repeat: Infinity, ease: 'easeInOut' }}
          style={{ top: '10%', left: '5%' }}
        />
        <motion.div
          className="absolute w-[22rem] h-[22rem] bg-[#4E8DC4]/60 rounded-full blur-[110px]"
          animate={{
            x: ['0%', '-50%', '60%', '0%'],
            y: ['0%', '40%', '-30%', '0%'],
          }}
          transition={{ duration: 25, repeat: Infinity, ease: 'easeInOut' }}
          style={{ bottom: '10%', right: '8%' }}
        />
      </div>

      {/* === MAIN CONTAINER === */}
      <motion.div
        initial={{ opacity: 0, scale: 0.9, y: 40 }}
        animate={{ opacity: 1, scale: 1, y: 0 }}
        transition={{ duration: 0.8, ease: 'easeOut' }}
        className="relative z-10 bg-white/90 backdrop-blur-xl border border-[#4E8DC4]/40 rounded-3xl shadow-2xl flex overflow-hidden w-11/12 max-w-5xl"
        style={{
          boxShadow: `
            -35px 0 70px -10px rgba(78,141,196,0.55),
            35px 0 70px -10px rgba(254,219,89,0.55)
          `,
        }}
      >
        {/* === LEFT PANEL === */}
        <div
          className="w-1/2 hidden md:flex flex-col items-center justify-center p-10 relative"
          style={{ backgroundColor: "#76AAE0", color: "#ffffff" }}
        >
          {/* Glow in background */}
          <motion.div
            className="absolute w-56 h-56 rounded-full blur-[80px] bg-[#FEDB59]/40"
            animate={{ x: [0, 15, -15, 0], y: [0, -10, 10, 0] }}
            transition={{ duration: 5, repeat: Infinity, ease: "easeInOut" }}
          />
          <motion.div
            className="absolute w-64 h-64 rounded-full blur-[90px] bg-[#4E8DC4]/30"
            animate={{ x: [0, -10, 10, 0], y: [0, 10, -10, 0] }}
            transition={{ duration: 6, repeat: Infinity, ease: "easeInOut" }}
          />

          {/* === LOGO === */}
          <motion.img
            src={rws_app_logo}
            alt="logo"
            className="w-36 h-36 object-contain relative z-10 mb-6"
            style={{
              filter: `
                drop-shadow(0 0 8px rgba(255,255,255,0.9))
                drop-shadow(0 0 18px rgba(255, 255, 255, 0.9))
                drop-shadow(0 0 28px rgba(255, 255, 255, 0.3))
              `,
            }}
            initial={{ rotate: -15, opacity: 0, scale: 0.5 }}
            animate={{ rotate: 0, opacity: 1, scale: 1 }}
            transition={{
              duration: 1.5,
              ease: 'easeOut',
              type: 'spring' ,
              stiffness: 100,
            }}
          />

          <h1 className="text-2xl font-extrabold text-center mb-2 drop-shadow-sm">
            RWS Productivity
          </h1>
          <p className="text-sm font-medium text-center opacity-90 max-w-xs">
            Stay organized. Stay focused. Achieve more with ease.
          </p>
        </div>

        {/* === RIGHT PANEL === */}
        <div className="w-full md:w-1/2 p-10 flex flex-col justify-center">
          <h2
            className="text-3xl font-extrabold mb-6 text-center bg-gradient-to-r from-[#4E8DC4] via-[#76AAE0] to-[#FEDB59] bg-clip-text text-transparent"
            style={{ WebkitBackgroundClip: 'text', WebkitTextFillColor: 'transparent' }}
          >
            Welcome Back!
          </h2>

          <form className="flex flex-col space-y-4" onSubmit={login_logic}>
            <input
              type="email"
              placeholder="Email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
              className="bg-[#f4f8fc] border border-[#4E8DC4]/50 rounded-lg px-4 py-3 text-[#4E8DC4] placeholder-[#4E8DC4]/60 focus:outline-none focus:ring-2 focus:ring-[#FEDB59] transition"
            />
            <input
              type="password"
              placeholder="Password"
              value={password}
              onChange={(e) => setPass(e.target.value)}
              required
              className="bg-[#f4f8fc] border border-[#4E8DC4]/50 rounded-lg px-4 py-3 text-[#4E8DC4] placeholder-[#4E8DC4]/60 focus:outline-none focus:ring-2 focus:ring-[#FEDB59] transition"
            />

            <motion.button
              whileHover={{ scale: 1.07 }}
              whileTap={{ scale: 0.93 }}
              disabled={loading}
              type="submit"
              className={`mt-4 font-semibold py-3 rounded-lg shadow-md transition ${
                loading
                  ? 'opacity-70 cursor-not-allowed'
                  : 'hover:shadow-[0_0_25px_rgba(254,219,89,0.6)]'
              }`}
              style={{
                backgroundColor: '#FEDB59',
                color: '#ffffff',
              }}
            >
              {loading ? 'Logging in...' : 'Login'}
            </motion.button>
          </form>

          {message && (
            <p className="mt-4 text-center text-sm text-[#4E8DC4]/80">{message}</p>
          )}

          <p className="mt-6 text-[#4E8DC4]/70 text-sm text-center">
            Don’t have an account?{' '}
            <button
              type="button"
              className="font-semibold hover:underline"
              style={{ color: '#76AAE0' }}
              onClick={() => alert('Sign-up page coming soon!')}
            >
              Sign up
            </button>
          </p>
        </div>
      </motion.div>
    </div>
  );
}

export default App;
